            var currentLocation = 'psdp';

            function applyDateFilter() {
                var start = document.getElementById("start-date").value;

                    // If no filter, reset to original data
                    plotData = JSON.parse(JSON.stringify(origData));
                    showPlot(currentLocation);
                    return;
                }
                var filtered = [];
                origData[currentLocation].data.forEach(function(trace) {
                    // Only filter traces with x (date) series
                    if (trace.x) {
                        var x = [], y = [];
                        for (var i = 0; i < trace.x.length; i++) {
                            var date = trace.x[i];
                            if ((!start || date >= start) && (!end || date <= end)) {
                                x.push(date);
                                if (trace.y) y.push(trace.y[i]);
                            }
                        }
                        var t = Object.assign({}, trace);
                        t.x = x;
                        if (trace.y) t.y = y;
                        filtered.push(t);
                    } else {
                        filtered.push(trace);
                    }
                });
                plotData[currentLocation].data = filtered;
                showPlot(currentLocation);
            }
